import turtle as t
import base64
from io import BytesIO
import os

# Base64 strings for images (replace these with actual base64 strings of your images)
car_image_base64 = "data:image/png;base64,"  # Replace with your own
bus_image_base64 = "data:image/png;base64,"  # Replace with your own
motorcycle_image_base64 = "data:image/png;base64,"  # Replace with your own
laptop_image_base64 = "data:image/png;base64,"  # Replace with your own
food_image_base64 = "data:image/png;base64,"  # Replace with your own

# Carbon Emission Factors (per day) stored in dictionaries
emission_factors = {
    "car": 0.24,            # Car emission factor (kg CO2 per km)
    "bus": 0.05,            # Bus emission factor (kg CO2 per km)
    "motorcycle": 0.15      # Motorcycle/Scooter emission factor (kg CO2 per km)
}

other_factors = [
    1.5,   # Air conditioner emission factor per hour (in kg CO2)
    0.5,   # Refrigerator emission factor per hour (in kg CO2)
    0.3,   # Electronics emission factor per hour (in kg CO2)
    0.5,   # Vegetarian meal emission factor (in kg CO2)
    2.0    # Non-vegetarian meal emission factor (in kg CO2)
]
# Input functions
def get_float_input(prompt):
    while True:
        try:
            value = float(input(prompt))
            if value < 0:
                print("Please enter a non-negative number.")
            else:
                return value
        except ValueError:
            print("Please enter a valid number.")

def get_int_input(prompt):
    while True:
        try:
            value = int(input(prompt))
            if value < 0:
                print("Please enter a non-negative integer.")
            else:
                return value
        except ValueError:
            print("Please enter a valid integer.")

def get_transport_mode():
    print("Select your mode of transport:")
    print("1. Car")
    print("2. Bus")
    print("3. Motorcycle/Scooter")
    while True:
        choice = input("Enter the number corresponding to your choice: ")
        if choice == "1":
            return "car"
        elif choice == "2":
            return "bus"
        elif choice == "3":
            return "motorcycle"
        else:
            print("Invalid choice, please select 1, 2, or 3.")

# Get user input
print("Please provide your daily carbon footprint information:")
mode_of_transport = get_transport_mode()
km_traveled = get_float_input("Enter kilometers traveled per day: ")

# Get electronic usage
ac_hours = get_float_input("Enter total hours of air conditioner usage per day: ")
fridge_hours = get_float_input("Enter total hours of refrigerator usage per day: ")
other_electronic_hours = get_float_input("Enter total hours of other electronic device usage per day: ")

# Get meal information
veg_meals = get_int_input("Enter number of vegetarian meals consumed per day: ")
non_veg_meals = get_int_input("Enter number of non-vegetarian meals consumed per day: ")

# Carbon Footprint Calculation (per day)
carbon_from_travel = km_traveled * emission_factors[mode_of_transport]
carbon_from_electronics = (ac_hours * other_factors[0]) + (fridge_hours * other_factors[1]) + (other_electronic_hours * other_factors[2])
carbon_from_meals = (veg_meals * other_factors[3]) + (non_veg_meals * other_factors[4])
total_carbon_footprint = carbon_from_travel + carbon_from_electronics + carbon_from_meals

# Function to format values to 1 decimal place and remove .0 if they are whole numbers
def format_value(value):
    rounded_value = round(value, 1)
    if rounded_value.is_integer():
        return int(rounded_value)
    return rounded_value

# Function to calculate perfect font size based on number length
def get_perfect_font_size(value):
    num_length = len(str(int(value)))
    if num_length <= 2:
        return 100  # Standard size for 1-2 digit numbers
    elif num_length == 3:
        return 80   # Smaller for 3-digit numbers
    elif num_length == 4:
        return 60   # Further reduced for 4-digit numbers
    else:
        return 40   # Minimized for larger numbers to fit precisely

def draw_infographic():
    t.title("Anup's Carbon Footprint Calculator")
    t.bgcolor("sky blue")

    try:
        t.getcanvas().winfo_toplevel().state("zoomed")  # For Windows
    except:
        t.setup(width=1.0, height=1.0)  # Fallback for other OS

    t.tracer(0)
    t.hideturtle()
    t.speed(0)

    draw_title(t, "Your Daily Carbon Footprint", y=250)

    # Update values for display without .0 if they are whole numbers
    travel_display = format_value(carbon_from_travel)
    electronics_display = format_value(carbon_from_electronics)
    meals_display = format_value(carbon_from_meals)
    total_display = format_value(total_carbon_footprint)

    # Draw individual sections with updated display values
    draw_total(t, total_display, y=-250)
    draw_impact_message(t, total_display, y=-275)
    draw_credit(t)

    # Transportation Circle
    t.penup()
    t.goto(-425, 100)
    t.pendown()
    t.color("#4FFFB0")
    t.seth(270)
    t.fillcolor("#4FFFB0")
    t.begin_fill()
    t.circle(125, 360, 3600)
    t.end_fill()
    t.color("black")

    # Add labels for Transportation
    t.penup()
    t.goto(-300, 170)  
    t.write("Transport", align="center", font=("TheBoldFont-Bold", 15, "bold"))
    t.goto(-310, 50)  
    t.write(travel_display, align="center", font=("TheBoldFont-Bold", get_perfect_font_size(travel_display), "bold"))
    t.goto(-300, 15)  
    t.write("kg CO2", align="center", font=("TheBoldFont-Bold", 40, "bold"))

    # Electronics Circle
    t.penup()
    t.goto(-125, 100)
    t.pendown()
    t.color("#B8D1E7")
    t.seth(270)
    t.fillcolor("#B8D1E7")
    t.begin_fill()
    t.circle(125, 360, 5000)
    t.end_fill()
    t.color("black")

    # Add labels for Electronics
    t.penup()
    t.goto(0, 170)  
    t.write("Electronics", align="center", font=("TheBoldFont-Bold", 15, "bold"))
    t.goto(0, 50)  
    t.write(electronics_display, align="center", font=("TheBoldFont-Bold", get_perfect_font_size(electronics_display), "bold"))
    t.goto(0, 10)  
    t.write("kg CO2", align="center", font=("TheBoldFont-Bold", 35, "bold"))

    # Meals Circle
    t.penup()
    t.goto(175, 100)
    t.pendown()
    t.color("#DC143C")
    t.seth(270)
    t.fillcolor("#DC143C")
    t.begin_fill()
    t.circle(125, 360, 3600)
    t.end_fill()
    t.color("black")

    # Add labels for Meals
    t.penup()
    t.goto(300, 170)  
    t.write("Meals", align="center", font=("TheBoldFont-Bold", 15, "bold"))
    t.goto(300, 50)  
    t.write(meals_display, align="center", font=("TheBoldFont-Bold", get_perfect_font_size(meals_display), "bold"))
    t.goto(300, 10)  
    t.write("kg CO2", align="center", font=("TheBoldFont-Bold", 35, "bold"))

    # Draw images based on the user's transport choice
    draw_transport_image(t, mode_of_transport)
    draw_electronics_image(t)
    draw_meals_image(t)

    # Draw the tips playcard
    tips = [
        "Use public transport when possible.",
        "Turn off electronics when not in use.",
        "Eat locally sourced food.",
        "Consider walking for short distances.",
        "Reduce, reuse, recycle!"
    ]
    draw_playcard_with_tips(t, 475, 350, 150, 230, 10, tips)
    draw_fridge()
    draw_tree()
