def get_feedback(total_carbon):
    if total_carbon < 25:
        return "Great job! Your carbon footprint is very low. Keep up the good work!"
    elif total_carbon < 50:
        return "Average footprint, this is a common level for many people."
    else:
        return "High footprint, consider making significant changes to reduce your carbon emissions."

def draw_playcard_with_tips(t, x, y, width, height, radius, tips):
    # Draw rounded rectangle
    t.penup()
    t.goto(x + radius, y)
    t.pendown()
    t.fillcolor("white")  # Cream color for the card
    t.begin_fill()
    
    # Draw top horizontal line
    t.forward(width - 2 * radius)
    
    # Draw top right curve
    t.circle(radius, 90)
    
    # Right vertical line
    t.forward(height - 2 * radius)
    
    # Bottom right curve
    t.circle(radius, 90)
    
    # Bottom horizontal line
    t.forward(width - 2 * radius)
    
    # Bottom left curve
    t.circle(radius, 90)
    
    # Left vertical line
    t.forward(height - 2 * radius)
    
    # Top left curve
    t.circle(radius, 90)
    
    t.end_fill()
    t.penup()

    # Add text inside the playcard
    t.goto(x + 20, y - radius - 20)  # Start position for text inside
    t.color("black")
    t.write("Tips to reduce emmisions:", align="left", font=("Arial", 12, "bold"))
    
    # Print each tip or feedback line on a new line
    line_y = y - radius - 40
    for tip in tips:
        t.goto(x + 20, line_y)
        t.write(f"{tip}", align="left", font=("Arial", 10, "normal"))
        line_y -= 20  # Move down for the next line

def draw_credit(t):
    t_width = t.window_width()
    t_height = t.window_height()
    
    t.penup()
    t.goto(t_width/2 +350, -t_height/2 -50)
    t.pendown()
    t.color("#333333")
    t.write("Made by Anup Sharma", align="right", font=("TheBoldFont-Bold", 15, "italic"))

def draw_title(t, text, y):
    t.penup()
    t.goto(0, y)
    t.pendown()
    t.color("black")
    t.write(text, align="center", font=("TheBoldFont-Bold", 20, "bold"))

def draw_total(t, total, y):
    t.penup()
    t.goto(0, y)
    t.pendown()
    t.color("#333333")
    t.write(f"Total Carbon Footprint: {total} kg CO2e", align="center", font=("Georgia", 18, "bold"))

def draw_impact_message(t, total, y):
    t.penup()
    t.goto(0, y)
    t.pendown()
    t.color("#333333")
    impact_message = (
        f"Your total CO2 emission is {total:.2f} kg CO2e.\n"
        f"{get_feedback(total)}\n"
        f"Reducing emissions helps protect our planet. Cut Carbon, Not Trees!\n"
    )
    for line in impact_message.split("\n"):
        t.write(line, align="center", font=("Georgia", 12, "italic"))
        t.penup()
        t.sety(t.ycor() - 20)
        t.pendown()

def draw_transport_image(t, mode):
    image_data = None
    temp_filename = None
    if mode == "car":
        image_data = car_image_base64
        temp_filename = "car_image.gif"
    elif mode == "bus":
        image_data = bus_image_base64
        temp_filename = "bus_image.gif"
    elif mode == "motorcycle":
        image_data = motorcycle_image_base64
        temp_filename = "motorcycle_image.gif"

    if image_data:
        t.penup()
        t.goto(-300, -100)  # Position for transport image
        t.pendown()
        t_image(t, image_data, temp_filename)

def draw_electronics_image(t):
    t.penup()
    t.goto(0, -100)  # Position for electronics image
    t.pendown()
    t_image(t, laptop_image_base64, "laptop_image.gif")

def draw_meals_image(t):
    t.penup()
    t.goto(300, -100)  # Position for meals image
    t.pendown()
    t_image(t, food_image_base64, "food_image.gif")

def t_image(t, data, filename):
    # Decode base64 data
    format_, img_data = data.split(',', 1)
    img_data = base64.b64decode(img_data)
    image = BytesIO(img_data)

    # Save to a temporary file with a unique name
    with open(filename, "wb") as f:
        f.write(image.getbuffer())  # Use getbuffer() for BytesIO

    t.register_shape(filename)
    t.shape(filename)
    t.stamp()

    # Remove the temporary file after use
    os.remove(filename)

draw_infographic()
